import React from "react";
import Header from "../Components/Header";
class ContactPage extends React.Component {
  constructor(props) {
    super();
    this.state = {
      name: "",
      email: "",
      message: "",
    };
  }

  render(props) {
    return <Header mainHeader={this.props.mainHeader} />;
  }
}

export default ContactPage;
